import Foundation

class DependencyInjector {
    // MARK: - ViewModel
    static func chooseViewModel() -> ChooseViewModel {
        return ChooseViewModel(loadFeelingUseCase: loadFeelingUseCase(), loadSelectedFeelingsUseCase: loadSelectedFeelingsUseCase(), feelingRepository: feelingRepository())
    }

    static func detailViewModel() -> DetailViewModel {
        return DetailViewModel(loadSelectedRestaurantUseCase: loadSelectedRestaurantUseCase())
    }

    static func mainViewModel() -> MainViewModel {
        return MainViewModel(
            loadRestaurantUseCase: loadRestaurantUseCase(),
            loadSelectedFeelingsUseCase: loadSelectedFeelingsUseCase(),
            loadRemoteUrlPresetDataUseCase: loadRemoteUrlPresetDataUseCase())
    }

    // MARK: - UseCase
    static func loadFeelingUseCase() -> LoadFeelingUseCase {
        return LoadFeelingUseCase(feelingRepository: feelingRepository())
    }

    static func loadSelectedRestaurantUseCase() -> LoadSelectedRestaurantUseCase {
        return LoadSelectedRestaurantUseCase(restaurantRepository: restaurantRepository())
    }

    static func loadSelectedFeelingsUseCase() -> LoadSelectedFeelingsUseCase {
        return LoadSelectedFeelingsUseCase(feelingRepository: feelingRepository())
    }

    static func loadRestaurantUseCase() -> LoadRestaurantUseCase {
        return LoadRestaurantUseCase(restaurantRepository: restaurantRepository())
    }

    static func loadRemoteUrlPresetDataUseCase() -> LoadRemoteUrlPresetDataUseCase {
        return LoadRemoteUrlPresetDataUseCase(remoteUrlPresetRepository: remoteUrlPresetRepository())
    }

